import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <div className="header">
      <img
        className="header__image"
        src="https://img.icons8.com/ios-filled/2x/home-page.png"
        alt=""
      />

      <ul>
        <li>About</li>
        <li>Projects</li>
        <li>Resume</li>
      </ul>
    </div>
  );
};

export default header;
